    onclick: "bbfontstyle('[b]Смесь № 1[/b]\\nДиоксидин 1% ампульный – 3 части,\\nНовокаин 2% ампульный – 1 часть.\\nУдобно сделать смесь: 30 мл диоксидина + 10 мл новокаина. \\nВсе хранить в бутылочке при КОМНАТНОЙ температуре, строго в темноте. В холодильник ставить НЕЛЬЗЯ. \\nСначала рана омывается хлоргексидином, а через 10 – 15 минут применяется смесь № 1.\\nНе менее 3 раз в сутки, а по возможности и чаще. \\n\\n[b]Смесь № 2[/b]\\nЧерез сутки примерно, когда на фоне обработки жидкостями и мазями ткани очистятся от мусора и клочков, нужно сделать смесь № 2.\\n[u]Не применяется на открытых ранах![/u]\\nДимексид – 10 мл\\nНовокаин – 2 мл\\nДексаметазон – 1 мл\\nЛинкомицин (30%, амп.) – 6 мл.\\nРаботать в перчатках.\\nУсловие для смеси № 2: отсутствие открытых «живых» ран.\\nНаносить 2 раза в день.\\nНе допускать попадания смеси № 2 в клюв.\\nПри приготовлении смеси выделяется тепло, поэтому работать аккуратно, смешивать все в термостойкой посуде, после остывания перелить в какую-либо емкость. \\nСмесь № 2 хранится, как и смесь № 1, в темноте при комнатной температуре. \\n\\nОбе смеси – «долгоиграющие», т.е. могут храниться месяц и даже долее.\\n', '')"
